import MainNavbar from '../MainNavbar.js';
import PastEvents from './PastEvents.js';
import UpcomingEvents from './UpcomingEvents.js';


function Events() {

    return(
        <>
            <MainNavbar activeTab="/events"/>
            <div className="container section events">
                <div className="row">
                    <div className="col-2 side-title">
                        <h3>Upcoming</h3>
                        <h3>Events</h3>
                        <hr/>
                        <p>lorem ipsum dolar et color dont etc.</p>
                    </div>
                    <div classsName="col-10 upcoming-events">
                        <UpcomingEvents/>
                    </div>
                </div>


                

                <PastEvents/>

            </div>
        </>
    );
}

export default Events;
